import React from "react";
import {Link, withRouter} from "react-router-dom";
function Navbar({match, history}) {

    console.log(history)

    const isActive = path =>{
        if(match.path === path) {
            return {color: "#000"}
        }else {
            return {color: "#f05454"}
        }

        
    }

    return <div>
        <Link style={isActive("/")} to="/">home</Link>
         <Link style={isActive("/signin")} to="signin">signin</Link>
        <Link style={isActive("/signup")} to="signup">signup</Link>
    </div>
}

export default withRouter(Navbar);
